import { useContext } from 'react';
import { AuthContext } from '../App';

function Checkout() {
  const { token } = useContext(AuthContext);

  return (
    <div>
      <h2>Checkout</h2>
      {token ? <p>Proceed to checkout (cart logic TBD).</p> : <p>Please log in to checkout.</p>}
    </div>
  );
}

export default Checkout;
